[RAR]
Archiver=rar
FallBackArchivers=rar,unrar
Description=RAR v5+ - http://www.rarlab.com
ID=52 61 72 21
IDPos=<SeekID>
IDSeekRange=
Extension=rar
Start=^-----------
End=^-----------
Format0=?aaaaaaaaaa $z+  yyyy tt dd hh mm  n+
List=%P l -c- {-p%W} %AQ
Extract=%P x -y {-p%W} {%S} %AQ @%LQ
ExtractWithoutPath=%PQ e -y {-p%W} {%S} %AQ @%LQ
Test=%P t -y {%S} %AQ
Delete=%P d -y {%S} %AQ @%LQ
Add=%P a -y {-p%W} {-v%V} {%S} %AQ "{-ap%R}" @%LQ
AddSelfExtract=%P a -y -sfx {-p%W} {-v%V} {%S} %AQ "{-ap%R}" @%LQ
PasswordQuery=Enter password
Flags=0
FormMode=0
Enabled=1
Output=0
Debug=0

[MultiArc]
FirstTime=1
